	innerHtml:	"<div name=\"dCon\" style=\"position: absolute; left: 0px; top: 0px; width: 571px; min-height: 321px;\"><div name=\"dCon2\" class=\"ttxt\" style=\"left: 5px; top: 5px; width: 561px; min-height: 311px;\"><p style=\"line-height: 1.5; margin-top: 0px; margin-bottom: 0px;\"><span style=\"font-size:14pt; color: rgb(51, 51, 51); font-family: Arial, sans-serif;\">Tema om bærekraftig matforbruk vet du kanskje litt om fra tidligere. Du har kanskje lært om det på skolen, i fritiden eller hjemme.&nbsp;</span></p>\n\n<p style=\"line-height: 1.5; margin-top: 0px; margin-bottom: 0px;\"><span style=\"font-size:14pt;\">​</span></p>\n\n<p style=\"line-height: 1.5; margin-top: 0px; margin-bottom: 0px;\"><span style=\"font-size:14pt; color: rgb(51, 51, 51); font-family: Arial, sans-serif;\">Før du setter i gang kan det være lurt å se på noen begreper som du vil møte på i teksten. Noen har du sikkert hørt om før, andre kan det være du er usikker på. Reflekter over begrepene du finner på neste side. Har du hørt om de før? Hva betyr de? Hvordan kan dette henge sammen med ditt matforbruk? Etterpå kan du klikke på pilen til høyre for begrepet for å finne svaret. Kunne du dette fra før av, eller lærte du noe nytt?</span></p></div></div>",
